import React from "react";
import {Provider} from "react-redux";
import Jugadores from "./components/Jugadores";
import Titulares from "./components/TItulares";
import store from "./store";
const App = () => (
  <Provider store={store}>
  <main>
    <h1> EdManager</h1>
    <Jugadores />
    <Titulares />
  </main>
  </Provider>
)
export default App;
